import React, { useEffect } from 'react'
import axiosInstance from '../../baseurl'

function Docchat() {
    useEffect(()=>{
        axiosInstance.post(`/ViewPatientstoChat`, {drid:localStorage.getItem('doclogid')})
    })
  return (
    <div className='container-top'>Docchat</div>
  )
}

export default Docchat
